import App from "./app";
import ReactDOM from "react-dom";
import { Provider } from "react-redux";
import store from "./store/index";

function All() {
  return (
    <>
      <Provider store={store}>
        <h1></h1>
        <App />
      </Provider>
    </>
  );
}

ReactDOM.render(<All />, document.getElementById("myRoot"));
